import Collection from "./Collection";
import collections from "../Data.json";
import styles from "../styles/collectionList.module.css"

import { Link } from "react-router-dom";

function CollectionList() {
	return (
		<>
			{collections.collection.map((collection) => (
				<>
					<Collection
						key={collection.id}
						name={collection.name}
						headline={collection.headline}
						info={collection.info}
						image={collection.image} // Just pass the image path
					/>
					<Link className={styles.btn} to={`collection${collection.id}`}>Discover</Link>
				</>
			))}
		</>
	);
}

export default CollectionList;
